if mibBuilder.loadTexts: s5TrStaCtlUpdateStats.setDescription('This is an action object used to cause configuration information for the station to be updated. The following value can be written: update(4)...causes update to be attempted The following values can be read: other(1)......configuration information not currently valid inactive(2)...the station is currently inactive stable(3).....configuration information is currently valid update(4).....updating configuration info The object s5TrStaCtlUpdateTime has the time that the configuration was last updated. If a station is currently not on the ring, the value inactive(2) will be returned. A SET with value update(4) to an inactive station will result in a value of inactive(2).')
