s5TrStaCtlNodeVersion = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 3, 3, 1, 7), OctetString().subtype(subtypeSpec=ValueSizeConstraint(0, 10))).setMaxAccess("readonly")
