s5TrTestPathTestTimer = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 1), TimeIntervalHrd().clone(400)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5TrTestPathTestTimer.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestPathTestTimer.setDescription('This is the timeout, in units of hundredths of a second, that the agent will wait for a reply to an LLC TEST command PDU caused by doing a SNMP SET to the object s5TrAgentTpStart with the value startTestSourceRoute(2) or startTestTransparent(3). This timer applies to all entries in table s5TrTestPathTable.')
s5TrTestPathAgeTimer = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 2), TimeIntervalSec().subtype(subtypeSpec=ValueRangeConstraint(0, 65535)).clone(300)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5TrTestPathAgeTimer.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestPathAgeTimer.setDescription('The amount of time, in units of seconds, that an entry remains in table s5TrTestPathTable before it is automatically removed. This value must be larger than the value of s5TrTestPathTimer. This timer applies to all entries in table s5TrTestPathTable. When the value is 0, no entry will be aged out.')
s5TrTestPathTable = MibTable((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3), )
if mibBuilder.loadTexts: s5TrTestPathTable.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestPathTable.setDescription("This table is used to initiate a 'path test' between the agent and a station in the flatnet. To start a path test, a SNMP SET operation is attempted with the value of the object s5TrTestTpStart set to startTestSourceRoute(2) or startTestTransparent(3). There can only be one test active between the agent and a particular station at any time. The table size has an implementation limit. It is determined by the agent. Note: Performing a path test on a destination station which does not recognize or reply to 802.2 TEST command PDU will result in a 'test-failed'.")
s5TrTestPathEntry = MibTableRow((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1), ).setIndexNames((0, "S5-TOKENRING-MIB", "s5TrTestTpIfIndex"), (0, "S5-TOKENRING-MIB", "s5TrTestTpAddrTo"))
if mibBuilder.loadTexts: s5TrTestPathEntry.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestPathEntry.setDescription('A row in the test path table. Entries can be created with a SNMP SET request by setting the object s5TrTestTpStart to either startTestSourceRoute(2) or startTestTransparent(3) or by setting the object s5TrTestTpRoute to some specific route string, with the index portion of the object specifying the source (s5TrTestTpIfIndex) and destination MAC address (s5TrTestTpAddrTo). If s5TrTestTpRoute is set to some specific route string and s5TrTestTpStart is not startTestSourceRoute(2), startTestTransparent(3), retryTestSourceRoute(4), retryTestTransparent(5), or clearTest(6), the agent will set s5TrTestTpStart to startTestSourceRoute(2). After the entry is created, it will live in the table until it is aged out by the value of s5TrTestPathAgeTimer or until it is removed by setting s5TrTestTpStart to clearTest(6).')
s5TrTestTpIfIndex = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1, 1), Integer32().subtype(subtypeSpec=ValueRangeConstraint(1, 65535))).setMaxAccess("readonly")
if mibBuilder.loadTexts: s5TrTestTpIfIndex.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestTpIfIndex.setDescription('The index from the ifTable of a token ring interface. This is the source of the TEST command PDU.')
s5TrTestTpAddrTo = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1, 2), OctetString().subtype(subtypeSpec=ValueSizeConstraint(6, 6)).setFixedLength(6)).setMaxAccess("readonly")
if mibBuilder.loadTexts: s5TrTestTpAddrTo.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestTpAddrTo.setDescription('The destination MAC address to be used for the testpath operation.')
s5TrTestTpStart = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1, 3), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6))).clone(namedValues=NamedValues(("other", 1), ("startTestSourceRoute", 2), ("startTestTransparent", 3), ("retryTestSourceRoute", 4), ("retryTestTransparent", 5), ("clearTest", 6))).clone('startTestSourceRoute')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5TrTestTpStart.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestTpStart.setDescription("This object is used to start or retry a test or delete an entry. The possible values that can be written are: startTestSourceRoute(2)...Start a path test for networks using source routing bridging. startTestTransparent(3)...Start a path test for networks using transparent bridging. retryTestSourceRoute(4)...Retry the path test for networks using source routing bridging. retryTestTransparent(5)...Retry the path test for networks using transparent bridging. clearTest(6)..........Delete an entry. The possible values that can be read are: other(1) none of the following. startTestSourceRoute(2)...Indicates a path test for networks using source routing bridging has been started. startTestTransparent(3)...Indicates a path test for networks using transparent bridging has been started. retryTestSourceRoute(4)...Indicates the path test for networks using source routing bridging has been retried. retryTestTransparent(5)...Indicates the path test for networks using transparent bridging has been retried. If s5TrTestTpStart is set to startTestTransparent(3) or retryTestTransparent(5), the value of s5TrTestTpRoute is ignored. A TEST command PDU without source routing information will be sent by the agent. If s5TrTestTpStart is set to startTestSourceRoute(2) or retryTestSourceRoute(5) and the value s5TrTestTpRoute is a zero length string, a single-route broadcast TEST command PDU will be sent to explore the route from the agent to s5TrTestTpAddrTo. If s5TrTestTpRoute contains some specific route, the agent will send a nonbroadcast TEST command PDU to check this route. If a test between the station identified by the object s5TrTestTpStart and the agent has already been started (so the s5TrTestTpStatus has value testInProgress(2)), the agent will return 'no error' to the SNMP SET request of a start or retry value. However, the agent will not initiate a new TEST command PDU. If the test cannot be started because of errors in the SET request, or because of some limitations on the agent side (e.g., the table limit has been exceeded), then the response to the SET request will be SNMP 'bad value' or 'general' error. For both start-test and retry-test the age-out time for the entry will be refreshed (i.e., as if the entry was just created).")
s5TrTestTpStatus = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("other", 1), ("testInProgress", 2), ("testPassed", 3), ("testFailed", 4)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: s5TrTestTpStatus.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestTpStatus.setDescription("The current status of the test. The possible values are : testInProgress(2)...The path test is currently in progress. testPassed(3).......The path test passed. testFailed(4).......The path test failed. If the interval of time between the agent's request and the station's response is less than s5TrTestPathTimer, then the value will be testPassed(3). If the interval is longer, the value will be testFailed(4). While the agent is waiting for a response, the value will be testInProgress(2).")
s5TrTestTpRoute = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1, 5), OctetString().subtype(subtypeSpec=ValueSizeConstraint(0, 15))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5TrTestTpRoute.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestTpRoute.setDescription("When this object is written via SNMP it specifies the path to be tested. If this object is not written when the row is created, it is filled in by the agent when the path test is completed. This object is an encoded octet string that specifies the source route path. The first octet represents the length in octets of the route string that follows. Each two octets that follow specify a ring number/bridge number pair representing an entry for a hop. The encoding is 3 nibbles for the ring number, and 1 nibble for bridge number. The maximum size of this path represents 7 hops (14 Octets). To initiate a test, write to this object with the appropriate route. If the corresponding table entry s5TrTestTpStart is not set, the agent will set s5TrTestTpStart to startTestSourceRoute(2) and start the test. If the agent and the station are both on the same ring, the length octet will be set to zero by agent. If a 'Transparent path test' succeeds and the route passes through transparent bridges, then length octet will be set to 1 by agent. This is to differentiate from the case that the station and the agent are on the same ring.")
s5TrTestTpDuration = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1, 6), TimeIntervalHrd()).setMaxAccess("readonly")
if mibBuilder.loadTexts: s5TrTestTpDuration.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestTpDuration.setDescription('This specifies the round trip time of a successful test in units of hundreds of a second. This object will be equal to the value of s5TrTestPathTimer if the test has failed')
s5TrTestTpTimeStamp = MibTableColumn((1, 3, 6, 1, 4, 1, 45, 1, 6, 7, 4, 3, 1, 7), TimeTicks()).setMaxAccess("readonly")
if mibBuilder.loadTexts: s5TrTestTpTimeStamp.setStatus('mandatory')
if mibBuilder.loadTexts: s5TrTestTpTimeStamp.setDescription('This is the time stamp (i.e., sysUpTime) of the last time that the path test was run successfully.')
